    const randomAmount = Math.floor(Math.random() * 4);

    return (
        <div>
            {vegetables.map((vegetable) => {
                console.log(vegetable.id);
                <ArticleSelectorFlex 
                    key={vegetable.id}
                    description={vegetable.articledescription}
                    amount={randomAmount}>
            </ArticleSelectorFlex>}
            )}
        </div>
    )

}
